import React from "react";
import Textfield from "../Textfield/Textfield";
import Todowrapper from "../Todowrapper/Todowrapper";
import "./Box.css";

export default () => {
  return (
    <div className="box">
      <Todowrapper />
      <button className="btn">
          <h3>+</h3>
      </button>
      <Textfield />
    </div>
  );
};
